alter trigger M_T_AUDR_G3E_STYLERULE_RULE disable;
alter trigger M_T_AUD_G3E_STYLERULE_RULE disable;

declare
  TYPE numArray IS TABLE OF NUMBER INDEX BY PLS_INTEGER;
  arrSNO  numArray;
  i       PLS_INTEGER;
begin
  select distinct G3E_SNO
    bulk collect into arrSNO
    from G3E_STYLERULE 
    where G3E_RULE in ('Primary Switch Symbol', 'Primary Switch Symbol - OMS'
                      ,'Primary Switch Symbol Large', 'Primary Switch Symbol Large - OMS');
  
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch Symbol';
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch Symbol - OMS';
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch Symbol Large';
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch Symbol Large - OMS';

  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch  Symbol'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch Symbol-SGO'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch Symbol-SGO Large'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch Detail Symbol-SGO'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch - OH Symbol'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch - OH Symbol Large'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch - OH Detail Symbol'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch - OH Network Detail Symbol'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch - UG Network Symbol'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch - UG Network Detail Symbol'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch - UG Network Symbol SGO'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Primary Switch - UG Network Symbol SGO Large'; -- obsolete
  
  for i in 1..arrSNO.COUNT loop
    delete from G3E_POINTSTYLE where G3E_SNO = arrSNO(i);
    delete from G3E_STYLE where G3E_SNO = arrSNO(i);
  end loop;
end;
/

alter trigger M_T_AUDR_G3E_STYLERULE_RULE enable;
alter trigger M_T_AUD_G3E_STYLERULE_RULE enable;

